column13:
Method for selecting a menu item from a menu on a screen, comprising of: 
a user activating selection from the menu by means of an input member which communicates with a processor unit which further communicates with the screen; 
showing the menu on the screen if the menu is not already being shown on the screen; 
selecting a predetermined menu item from the menu; 
indicating on the screen the predetermined menu item in the menu; 
selecting a subsequent menu item from the menu by moving a pointer a relatively small distance outside the area on the screen covered by the menu, wherein the distance over which the pointer has moved is shorter than the distance between the selected menu item and the menu item to be selected; 
indicating the selected menu item on the screen; 
executing at least one command associated with the selected menu item after operating an input member.
